import "./App.css";
import { useState } from "react";

function App() {
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");

  const saveUser = () => {
    fetch("http://localhost:8081/saveuser", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        username: username,
        email: email,
      }),
    })
      .then((res) => res.json())
      .then((json) => {
        console.log(json);
      });
  };

  return (
    <div className="App">
      <div className="form">
        <div>
          <label for="username">Name</label>{" "}
          <input
            id="username"
            value={username}
            onChange={(e) => {
              setUsername(e.target.value);
            }}
          />
        </div>
        <div>
          <label for="email">Email</label>{" "}
          <input
            id="email"
            value={email}
            onChange={(e) => {
              setEmail(e.target.value);
            }}
          />
        </div>
        <div>
          <button onClick={saveUser}>Submit</button>
        </div>
      </div>
    </div>
  );
}

export default App;
